import "./../css/Header.css";

const Header = () => {
	return (
		<header className='header'>
			<img src='https://avatars.mds.yandex.net/i?id=4a2827119503aa4c267b4b4d0db59d81-5865432-images-thumbs&n=13&exp=1' alt="logo"/>
		</header>
	);
}

export default Header;
